import React from 'react'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import CloseButton from 'react-bootstrap/CloseButton'
import ExampleButton from './show_example/ExampleButton'

const ModelsCards = ({fileName, dataTime, featuresNames}) => {
    return (
        <div style={{color: "black"}}>

                <Card style={{ width: '16rem',  }}>
                <Card.Body >
                    <CloseButton onClick={() => console.log("X Clicked")}/>
                    <Button 
                        style={{padding: '2rem'}}
                        onClick={() => console.log("Card Clicked")}
                        variant="light">
                        <Card.Title>{fileName}</Card.Title>
                        <Card.Subtitle className="mb-2 text-muted">{dataTime}</Card.Subtitle>
                    </Button>
                    <Card.Text>
                        <ExampleButton
                            buttonText={"Show Model Features"}
                            tableTitle={"Features:"}
                            tableFeatures={featuresNames}
                            tableItems={[]}
                        />
                    </Card.Text>
                </Card.Body>
                <Card.Footer className="text-muted">2 days ago</Card.Footer>
                </Card>
            
        </div>
    )
}

export default ModelsCards
